script: |
  super -f text -I q3914.spq | sort > q3914.out

inputs:
  - name: q3914.spq
    data: |
      SELECT - col1 + + col2 FROM tab2 (FORMAT parquet) WHERE NOT + col0 BETWEEN - col1 * - col2 * + col0 AND col2 + - col1;
  - name: tab2

outputs:
  - name: q3914.out
    data: |
      -33
      -4
      21
